import logo from './logo.svg';
import './App.css';
import Header from "./component/header/Header"
import MyNavbar from './component/header/Navbar';
import CarouselComponent from './component/header/Carousel';
import ShortsCarousel from "./component/header/Teamcard";
import Fpoa from "./component/hero/Fpoa";
import Card from './component/hero/Card';
import cardData from './component/hero/Carddata';
// import PointsCard from './component/hero/Teamdata';
import TeamCard from './component/hero/Teamdata';




const teamCard = [
  {
    rank: 1,
    team: 'PUNJAB KINGS',
    logo: '/images/punjab.png',
    points: 19,
    played: 14,
    won: 9,
    nrr: '0.372',
    recentForm: ['W', 'L', 'W', 'W', 'W']
  },
  {
    rank: 2,
    team: 'ROYAL CHALLENGERS BENGALURU',
    logo: '/images/rcb.png',
    points: 19,
    played: 14,
    won: 9,
    nrr: '0.301',
    recentForm: ['W', 'L', 'N', 'W', 'W']
  },
  {
    rank: 3,
    team: 'GUJARAT TITANS',
    logo: '/images/gt.png',
    points: 18,
    played: 14,
    won: 9,
    nrr: '0.254',
    recentForm: ['L', 'L', 'W', 'W', 'W']
  },
  {
    rank: 4,
    team: 'MUMBAI INDIANS',
    logo: '/images/mi.png',
    points: 16,
    played: 14,
    won: 8,
    nrr: '1.142',
    recentForm: ['L', 'W', 'L', 'W', 'W']
  },
  {
    rank: 5,
    team: 'DELHI CAPITALS',
    logo: '/images/dc.png',
    points: 15,
    played: 14,
    won: 7,
    nrr: '0.000',
    recentForm: ['W', 'L', 'L', 'N', 'L']
  }
];




function App() {

  return (
    <div>
    <Header/>  
    <MyNavbar/>
    <CarouselComponent/> 
    <div className="min-h-screen bg-[#0D1126] flex items-center justify-center p-6">
      <ShortsCarousel />
    </div>
    <Fpoa/>
    <div className="card-container">
      {cardData.map((item) => (
        <Card
          key={item.id}
          title={item.title}
          description={item.description}
          image={item.image}
        />
      ))}
    </div>
   <div className="points-table">
      <h2>Points Table</h2>
      <div className="card-container">
        {teamCard.map((card, index) => (
          <TeamCard key={index} {...card} />
        ))}
      </div>
    </div>
    </div>
  );
}

export default App;
